import React, { useState, useEffect } from 'react';
import { Outlet, Link, useNavigate } from 'react-router-dom';
import axios from 'axios';
import '../css/Layout.css'; // Ensure this CSS file exists and is correctly linked

const Layout = () => {
  const [currentUser, setCurrentUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  // Function to check authentication and fetch user data
  const fetchCurrentUser = async () => {
    setLoading(true); // Ensure loading state is true at the start
    try {
      const response = await axios.get('http://localhost:5000/api/protected', {
        withCredentials: true, // Include cookies in the request
      });
      // Assuming the backend returns user data in response.data.user
      setCurrentUser(response.data.user);
    } catch (error) {
      if (error.response && (error.response.status === 401 || error.response.status === 403)) {
        // Handle unauthorized or forbidden errors (invalid/missing token)
        setCurrentUser(null); // User is not authorized
      } else {
        // Log other errors for debugging
        console.error('Error fetching current user:', error);
        setCurrentUser(null); // Treat other errors as potentially logged out as well
      }
    } finally {
      setLoading(false);
    }
  };

  // Function to handle logout
  const handleLogout = async () => {
    try {
      // Send POST request to the logout endpoint
      await axios.post('http://localhost:5000/api/logout', {}, { withCredentials: true });
      setCurrentUser(null); // Clear user data in the state
      navigate('/auth', { replace: true }); // Redirect to the authentication page
    } catch (error) {
      console.error('Error during logout:', error);
      // Optionally inform the user about the error
    }
  };

  useEffect(() => {
    fetchCurrentUser(); // Check authentication when the component mounts
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []); // Empty dependency array ensures this runs only once on mount

  if (loading) {
    return <p>Loading user information...</p>; // Loading indicator
  }

  return (
    <div className="layout-container">
      {/* Header */}
      <header className="header">
        <div className="header-left">
          {/* Use Link for internal navigation */}
          <Link to="/home" className="logo-link">
            <h1 className="logo">MyApp</h1>
          </Link>
        </div>
        <div className="header-right">
          {currentUser ? (
            <div className="user-info">
              {/* Display username - backend sends 'name', not 'email' in the default JWT payload */}
              <span className="user-name">Welcome, {currentUser.name}</span>
              <Link to="/profile" className="profile-button">
                Profile
              </Link>
              <button onClick={handleLogout} className="logout-button">
                Logout
              </button>
            </div>
          ) : (
            <Link to="/auth" className="login-link">
              Login
            </Link>
          )}
        </div>
      </header>

      {/* Main Content Area */}
      <div className="main-content">
        {/* Sidebar - Only show if logged in */}
        {currentUser && (
          <aside className="sidebar">
            <nav className="nav-menu">
              <ul>
                <li>
                  <Link to="/home" className="nav-link">
                    <i className="fas fa-home"></i> Home
                  </Link>
                </li>
                <li>
                  <Link to="/profile" className="nav-link">
                    <i className="fas fa-user"></i> Profile
                  </Link>
                </li>
                {/* Note: The '/settings' route is not defined in the App.js you provided.
                           This link will lead to the NotFound page unless added. */}
                <li>
                  <Link to="/settings" className="nav-link">
                    <i className="fas fa-cog"></i> Settings
                  </Link>
                </li>
                {/* Add other menu items as needed */}
              </ul>
            </nav>
          </aside>
        )}

        {/* Content Area */}
        {/* Render sidebar conditionally or adjust layout if sidebar is persistent */}
        <main className={`content-area ${currentUser ? 'with-sidebar' : 'full-width'}`}>
          {/* Outlet renders the matched child route component (Home, Profile, Detail etc.) */}
          <Outlet />
        </main>
      </div>
    </div>
  );
};

export default Layout;
